selector_to_html = {"a[href=\"Level3_anno.html#cycling-mesenchyme\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Cycling Mesenchyme<a class=\"headerlink\" href=\"#cycling-mesenchyme\" title=\"Permalink to this heading\">#</a></h2><p>This subcluster of mesenchyme expresses cell cycle-related genes, such as <em>Top2a</em>. It also expresses early mesenchyme marker genes, such as <em>Tfap2b</em> and <em>Lhx6</em> <span id=\"id11\">[<a class=\"reference internal\" href=\"../references.html#id2\" title=\"Junjun Jing, Jifan Feng, Yuan Yuan, Tingwei Guo, Jie Lei, Fei Pei, Thach-Vu Ho, and Yang Chai. Spatiotemporal single-cell regulatory atlas reveals neural crest lineage diversification and cellular function during tooth morphogenesis. Nature Communications, 13(1):4803, August 2022. doi:10.1038/s41467-022-32490-y.\">Jing <em>et al.</em>, 2022</a>]</span>.\n<img alt=\"png\" src=\"../_images/C19-7.png\"/></p>", "a[href=\"Level3_anno.html#pre-odontoblast\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pre-odontoblast<a class=\"headerlink\" href=\"#pre-odontoblast\" title=\"Permalink to this heading\">#</a></h2><p>We named this cluster based on the following reasons:</p>", "a[href=\"Level3_anno.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Level 3 Annotation<a class=\"headerlink\" href=\"#level-3-annotation\" title=\"Permalink to this heading\">#</a></h1><h2>Motivation<a class=\"headerlink\" href=\"#motivation\" title=\"Permalink to this heading\">#</a></h2><p><img alt=\"png\" src=\"../_images/C19_clusters.png\"/>\nIn level 3 annotation, we aim to identify subclusters of mesenchyme cells.\n<img alt=\"png\" src=\"../_images/anno_level1_level3.png\"/></p>", "a[href=\"Level3_anno.html#tfap2b-mesenchyme-hic1-mesenchyme-pax3-mesenchyme\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tfap2b+ Mesenchyme, Hic1+ Mesenchyme, Pax3+ Mesenchyme<a class=\"headerlink\" href=\"#tfap2b-mesenchyme-hic1-mesenchyme-pax3-mesenchyme\" title=\"Permalink to this heading\">#</a></h2><p>These clusters were mainly annotated based on their marker genes.\n<img alt=\"png\" src=\"../_images/C19-mes.png\"/></p>", "a[href=\"Level3_anno.html#low-quality-2\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Low Quality 2<a class=\"headerlink\" href=\"#low-quality-2\" title=\"Permalink to this heading\">#</a></h2><p><img alt=\"png\" src=\"../_images/C19-18.png\"/></p>", "a[href=\"Level3_anno.html#osteoblast\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Osteoblast<a class=\"headerlink\" href=\"#osteoblast\" title=\"Permalink to this heading\">#</a></h2><p>We discovered a cell cluster that highly expresses osteogenesis markers, such as <em>Cd200</em> <span id=\"id1\">[<a class=\"reference internal\" href=\"../references.html#id33\" title=\"Shawon Debnath, Alisha R. Yallowitz, Jason McCormick, Sarfaraz Lalani, Tuo Zhang, Ren Xu, Na Li, Yifang Liu, Yeon Suk Yang, Mark Eiseman, Jae-Hyuck Shim, Meera Hameed, John H. Healey, Mathias P. Bostrom, Dan Avi Landau, and Matthew B. Greenblatt. Discovery of a periosteal stem cell mediating intramembranous bone formation. Nature, 562(7725):133, September 2018. doi:10.1038/s41586-018-0554-8.\">Debnath <em>et al.</em>, 2018</a>]</span>, <em>Alpl</em> <span id=\"id2\">[<a class=\"reference internal\" href=\"../references.html#id34\" title=\"Wenjia Liu, Liqiang Zhang, Kun Xuan, Chenghu Hu, Shiyu Liu, Li Liao, Bei Li, Fang Jin, Songtao Shi, and Yan Jin. Alpl prevents bone ageing sensitivity by specifically regulating senescence and differentiation in mesenchymal stem cells. Bone Research, 6(1):1\u201315, September 2018. doi:10.1038/s41413-018-0029-4.\">Liu <em>et al.</em>, 2018</a>]</span>, and <em>Ifitm5</em> <span id=\"id3\">[<a class=\"reference internal\" href=\"../references.html#id37\" title=\"Ugur M. Ayturk, Joseph P. Scollan, Didem Goz Ayturk, Eun Sung Suh, Alexander Vesprey, Christina M. Jacobsen, Paola Divieti Pajevic, and Matthew L. Warman. Single-Cell RNA Sequencing of Calvarial and Long-Bone Endocortical Cells. Journal of Bone and Mineral Research, 2021.\">Ayturk <em>et al.</em>, 2021</a>]</span>.\n<img alt=\"png\" src=\"../_images/C19-4.png\"/></p>", "a[href=\"#details-of-each-level-annotation\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Details of Each Level Annotation<a class=\"headerlink\" href=\"#details-of-each-level-annotation\" title=\"Permalink to this heading\">#</a></h2><p>In this section, we explain the details of each level annotation.</p><p>Annotate tooth atlas is a difficult task, bacause of following reasons:</p>", "a[href=\"Level3_anno.html#coronal-papilla\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Coronal Papilla<a class=\"headerlink\" href=\"#coronal-papilla\" title=\"Permalink to this heading\">#</a></h2><p>We annotated the coronal papilla based on the expression of <em>Lmo</em> <span id=\"id9\">[<a class=\"reference internal\" href=\"../references.html#id2\" title=\"Junjun Jing, Jifan Feng, Yuan Yuan, Tingwei Guo, Jie Lei, Fei Pei, Thach-Vu Ho, and Yang Chai. Spatiotemporal single-cell regulatory atlas reveals neural crest lineage diversification and cellular function during tooth morphogenesis. Nature Communications, 13(1):4803, August 2022. doi:10.1038/s41467-022-32490-y.\">Jing <em>et al.</em>, 2022</a>]</span>.\n<img alt=\"png\" src=\"../_images/C19-12.png\"/></p>", "a[href=\"Level3_anno.html#dental-follicle\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Dental follicle<a class=\"headerlink\" href=\"#dental-follicle\" title=\"Permalink to this heading\">#</a></h2><p>This cluster expressed dental follicle markers, such as <em>Bmp3</em>, <em>Hhip</em> <span id=\"id8\">[<a class=\"reference internal\" href=\"../references.html#id2\" title=\"Junjun Jing, Jifan Feng, Yuan Yuan, Tingwei Guo, Jie Lei, Fei Pei, Thach-Vu Ho, and Yang Chai. Spatiotemporal single-cell regulatory atlas reveals neural crest lineage diversification and cellular function during tooth morphogenesis. Nature Communications, 13(1):4803, August 2022. doi:10.1038/s41467-022-32490-y.\">Jing <em>et al.</em>, 2022</a>]</span>.\n<img alt=\"png\" src=\"../_images/C19-5.png\"/></p>", "a[href=\"Level3_anno.html#high-mito\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">High-Mito<a class=\"headerlink\" href=\"#high-mito\" title=\"Permalink to this heading\">#</a></h2><p>This cluster of cells highly expresses mitochondrial-related genes, which may be related to <a class=\"reference external\" href=\"https://kb.10xgenomics.com/hc/en-us/articles/360001086611-Why-do-I-see-a-high-level-of-mitochondrial-gene-expression\">technical bias</a>.\n<img alt=\"png\" src=\"../_images/C19-14.png\"/></p>", "a[href=\"Level3_anno.html#motivation\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Motivation<a class=\"headerlink\" href=\"#motivation\" title=\"Permalink to this heading\">#</a></h2><p><img alt=\"png\" src=\"../_images/C19_clusters.png\"/>\nIn level 3 annotation, we aim to identify subclusters of mesenchyme cells.\n<img alt=\"png\" src=\"../_images/anno_level1_level3.png\"/></p>", "a[href=\"#annotation\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Annotation<a class=\"headerlink\" href=\"#annotation\" title=\"Permalink to this heading\">#</a></h1><p>In this section, we will adapt the annotation pipeline from <a class=\"reference external\" href=\"https://github.com/lsteuernagel/scHarmonization/\">scHarmonization</a> <span id=\"id1\">[<a class=\"reference internal\" href=\"../references.html#id22\" title=\"Lukas Steuernagel, Brian Y. H. Lam, Paul Klemm, Georgina K. C. Dowsett, Corinna A. Bauder, John A. Tadross, Tamara Sotelo Hitschfeld, Almudena del Rio Martin, Weiyi Chen, Alain J. de Solis, Henning Fenselau, Peter Davidsen, Irene Cimino, Sara N. Kohnke, Debra Rimmington, Anthony P. Coll, Andreas Beyer, Giles S. H. Yeo, and Jens C. Br\u00fcning. HypoMap\u2014a unified single-cell gene expression atlas of the murine hypothalamus. Nature Metabolism, 4(10):1402\u20131419, October 2022. doi:10.1038/s42255-022-00657-y.\">Steuernagel <em>et al.</em>, 2022</a>]</span> to our data.\nYou can just run this pipeline directly. Here, I just break down the pipeline into several steps for better understanding.</p>", "a[href=\"Level3_anno.html#kit-papilla\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Kit+ Papilla<a class=\"headerlink\" href=\"#kit-papilla\" title=\"Permalink to this heading\">#</a></h2><p>This cluster highly expresses <em>Kit</em> and <em>Pclo</em>, aligning with results from this study <span id=\"id10\">[<a class=\"reference internal\" href=\"../references.html#id30\" title=\"Yingchun Zheng, Ting Lu, Leitao Zhang, Zhongzhi Gan, Aoxi Li, Chuandong He, Fei He, Sha He, Jian Zhang, and Fu Xiong. Single-cell RNA-seq analysis of rat molars reveals cell identity and driver genes associated with dental mesenchymal cell differentiation. BMC Biology, 22(1):1\u201313, September 2024. doi:10.1186/s12915-024-01996-w.\">Zheng <em>et al.</em>, 2024</a>]</span>.\n<img alt=\"png\" src=\"../_images/C19-16.png\"/></p>", "a[href=\"Level3_anno.html#c1qtnf3-mesenchyme\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">C1qtnf3+ Mesenchyme<a class=\"headerlink\" href=\"#c1qtnf3-mesenchyme\" title=\"Permalink to this heading\">#</a></h2><p>We identified a cluster that specifically expresses <em>C1qtnf3</em>, aligning with the study <span id=\"id12\">[<a class=\"reference internal\" href=\"../references.html#id36\" title=\"Hong Hu, Yufeng Duan, Kun Wang, Huancheng Fu, Yuansong Liao, Tianshu Wang, Ziwei Zhang, Fanchen Kang, Baiquan Zhang, Haiying Zhang, Fangjun Huo, Yike Yin, Guoqing Chen, Hongbo Hu, Haoyang Cai, Weidong Tian, and Zhonghan Li. Dental niche cells directly contribute to tooth reconstitution and morphogenesis. Cell Reports, 41(10):111737, December 2022. doi:10.1016/j.celrep.2022.111737.\">Hu <em>et al.</em>, 2022</a>]</span>.\n<img alt=\"png\" src=\"../_images/C19-3.png\"/></p>", "a[href=\"Level3_anno.html#cementoblast\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Cementoblast<a class=\"headerlink\" href=\"#cementoblast\" title=\"Permalink to this heading\">#</a></h2><p>Our atlas also identified cementoblasts, which express <em>Pthlh</em> <span id=\"id4\">[<a class=\"reference internal\" href=\"../references.html#id35\" title=\"Mizuki Nagata, Angel Ka Yan Chu, Noriaki Ono, Joshua D. Welch, and Wanida Ono. Single-Cell Transcriptomic Analysis Reveals Developmental Relationships and Specific Markers of Mouse Periodontium Cellular Subsets. Frontiers in dental medicine, 2:679937, August 2021. doi:10.3389/fdmed.2021.679937.\">Nagata <em>et al.</em>, 2021</a>]</span>, <em>Tubb3</em> <span id=\"id5\">[<a class=\"reference internal\" href=\"../references.html#id35\" title=\"Mizuki Nagata, Angel Ka Yan Chu, Noriaki Ono, Joshua D. Welch, and Wanida Ono. Single-Cell Transcriptomic Analysis Reveals Developmental Relationships and Specific Markers of Mouse Periodontium Cellular Subsets. Frontiers in dental medicine, 2:679937, August 2021. doi:10.3389/fdmed.2021.679937.\">Nagata <em>et al.</em>, 2021</a>]</span>, <em>Ibsp</em> <span id=\"id6\">[<a class=\"reference internal\" href=\"../references.html#id29\" title=\"Florian Hermans, Celine Bueds, Lara Hemeryck, Ivo Lambrichts, Annelies Bronckaers, and Hugo Vankelecom. Establishment of inclusive single-cell transcriptome atlases from mouse and human tooth as powerful resource for dental research. Frontiers in Cell and Developmental Biology, 2022.\">Hermans <em>et al.</em>, 2022</a>]</span>, and <em>MMp13</em> <span id=\"id7\">[<a class=\"reference internal\" href=\"../references.html#id29\" title=\"Florian Hermans, Celine Bueds, Lara Hemeryck, Ivo Lambrichts, Annelies Bronckaers, and Hugo Vankelecom. Establishment of inclusive single-cell transcriptome atlases from mouse and human tooth as powerful resource for dental research. Frontiers in Cell and Developmental Biology, 2022.\">Hermans <em>et al.</em>, 2022</a>]</span>.\n<img alt=\"png\" src=\"../_images/C19_8_marker.png\"/></p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`div.content ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
